import React from 'react';
import 'antd/dist/antd.css';
import { Input } from 'antd';

class TodoList extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <Input placeholder="todo info" style={{width: '300px'}} />
                </div>
            </div>
        );
    }
}

export default TodoList;
